import React from "react";
import styles from "../../index.module.scss";

function UsersList({ users }) {
  return (
    <>
      {users.map((user) => {
        return (
          <div className={styles.userCard}>
            <div>{user.name}</div>
          </div>
        );
      })}
    </>
  );
}

export default UsersList;
